import styled from 'styled-components';

export const Container = styled.img`
    min-height: 180px;
    max-height: 180px;
    width: auto;
    height: 30vh;
    background-color: #f5f5f5;
    display: flex;
    justify-content: center;
    align-items: center;
    overflow: hidden;
    background: #000;
    background-size: cover
`;
